import React from 'react';

const RoleList = (props) => {
    const rl = [];


    if (rl.length > 0) {
        return (
            <div>
                {props["clashteam"]["players"].map((value, index) => <h1 key={index}>{value.name}</h1>)}
            </div>
        );
    }
    else return (<div></div>);
}

export default RoleList;
